data:
  definition: qualifies a port or a device through which a device or an equipment
    delivers a signal, an energy, a power or information, or by extension this signal,
    energy, power or information, or any associated quantity
  examples: []
  notes:
  - The term "output" is also used as a noun to designate an output port, an output
    signal, etc.
